frontApp.controller("showProductController",["$scope","$http","$window","CategoryProduct",function(n,t){n.product={};n.products=[];n.idCategoryProduct;n.idProduct=angular.element("#idCategory").val();t.get("/API/ProductsAPI/"+n.idProduct).success(function(i){n.product=i;n.idCategoryProduct=i.idCategoryProduct;t.get("/API/ProductsAPI/").success(function(t){angular.forEach(t,function(t){t.idCategoryProduct==n.idCategoryProduct&&t.idProduct!=n.idProduct&&n.products.push(t)})})})}]);